function Instagram() {
  const mergeImgs = [...insImages1, ...(insImages2.slice(0, 3))];
  return (
    <div>
      <h4>Instagram</h4>

      <Row className="th-row-thumbail-nopad">
        {
          mergeImgs.map((item) => {
            return (
              <Col sm="4" className="th-thumbail-nopad">
